import List from '@mui/material/List';
import Divider from '@mui/material/Divider';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import PersonIcon from '@mui/icons-material/Person';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import InboxIcon from '@mui/icons-material/MoveToInbox';
import MailIcon from '@mui/icons-material/Mail';
import user from "../assets/image/user.jpg";
import { Avatar, IconButton,TextField, Typography } from '@mui/material';
import { memo } from 'react';
import moment from 'moment/moment';
import { nodeUrl } from '../config';
import App from './profileModal';
 function SwipeableTemporaryDrawer({leftTrue,profileList}) {
  const [state, setState] = React.useState({
    right:false,                          
  });
console.log(profileList)

  const toggleDrawer = (anchor, open) => (event) => {
    if (
      event &&
      event.type === 'keydown' &&
      (event.key === 'Tab' || event.key === 'Shift')
    ) {
      return;
    }
    setState({ ...state, [anchor]: open });
  };
  
  React.useEffect(() => {
    setState(leftTrue)
    toggleDrawer("right",state.right)
    }, [leftTrue])
  const list = (anchor) => (
    <Box  
      sx={{ width: anchor === 'top' || anchor === 'bottom' ? 'auto' : 250 }}
      role="presentation"
      // onClick={toggleDrawer(anchor, false)}
      onKeyDown={toggleDrawer(anchor, false)}
    >
    
      {/* <img src={user}></img> */}
      <h4 className='py-5 ml-3'>Profile</h4>
      <Divider/>
      {/* <img src={user} class="rounded mx-auto d-block py-5" alt="..."></img> */}
      <Avatar alt="Remy Sharp" className='mx-auto d-block m-3' src={`${nodeUrl+profileList.image_path}`} sx={{ width: 120, height: 120 }} />
      {/* {profileList.map(value=>{})} */}
{/* <Typography>xcvbnm</Typography> */}

<list
  sx={{ width: '100%', maxWidth: 360, bgcolor: 'background.paper' }}
  component="nav"
  aria-labelledby="nested-list-subheader"
>
<ListItemButton>
  <ListItemIcon>
    <PersonIcon/>
  </ListItemIcon>
  <ListItemText primary="Profile" />
</ListItemButton>

</list>

