          variant="standard"/>
      </div>
      <div className='d-flex justify-content-center py-3'>
      <TextField
          label="Mobile No"
          id="standard-size-small"
          value={profileList.mobile}
          size="small"
          variant="standard"/>
      </div>
      <div className='d-flex justify-content-center py-3'>
      <TextField
          label="Email"
          id="standard-size-small"
          value={profileList.email}
          size="small"
          variant="standard"/>
      </div>
      <div className='d-flex justify-content-center py-3'>
        
      <TextField
          label="D.O.B"
          id="standard-size-small"
         value={moment(profileList.dob).format('l')}
          size="small"
          variant="standard"/>
      </div>
      <div className='d-flex justify-content-center py-3'>
      <TextField
          label="Gender"
          id="standard-size-small"
          value={profileList.gender}
          size="small"
          variant="standard"/>
      </div>
      <div className='d-flex justify-content-center py-3'>
      <TextField
          label="Department Name"
          id="standard-size-small"
         value={profileList.department_name}
          size="small"
          variant="standard"/>
      </div>
      <div className='d-flex justify-content-center py-3'>
      <TextField
          label="Relationship"
          id="standard-size-small"
          value={profileList.m_status}
          size="small"
          variant="standard"/>
      </div>
      <div className='d-flex justify-content-center py-3'>
      <TextField
          label="Father Or Husband Name"
          id="standard-size-small"
        value={profileList.Father_husband_name}
          size="small"
          variant="standard"/>
      </div>
      <div className='d-flex justify-content-center py-3'>
      <TextField
          label="Mother Name"
          id="standard-size-small"
         value={profileList.mother_name}
